import { Grid, GridList, GridListTile, makeStyles, Typography } from '@material-ui/core';
import React from 'react';
import AppContent from '../Content/AppContent';
import AppbarGeneric from '../Generics/AppbarGeneric';
import clsx from 'clsx';
import { AccountCircleOutlined } from '@material-ui/icons';

const useStyles = makeStyles((theme) => ({
    content: {
        justifyContent:"center",
        alignItems:"flex-start",
        overflowX: "hidden",
        spacing: 10
    },
    tile: {
        border: "1px solid black"
    },
    avatar: {
        alignSelf:"center",
        margin: "auto",
        fontSize: 60,
        backgroundColor: 'yellow'
    }
}));

const ProfilePage: React.FC = () => {

    const styles = useStyles();

    return(
        <React.Fragment>
        <AppbarGeneric />
            <AppContent>
            <div style={{margin:0, padding:20}}>
                <GridList cols={2} className={styles.content}>
                    <GridListTile style={{height: '170px', backgroundColor: 'green'}} className={styles.tile}>
                        <AccountCircleOutlined className={styles.avatar} />
                    </GridListTile>
                    <GridList cols={1}>
                        <GridListTile style={{backgroundColor: 'green', height: '50px'}} className={styles.tile}>
                        <Typography>
                            NAME AND SETTINGS
                        </Typography>
                        </GridListTile>
                        <GridListTile style={{backgroundColor: 'green', height: '50px'}} className={styles.tile}>
                        <Typography>
                            PURSES
                        </Typography>
                        </GridListTile>
                        <GridListTile style={{backgroundColor: 'green', height: '50px'}} className={styles.tile}>
                        <Typography>
                            ANOTHER INTORMATION
                        </Typography>
                        </GridListTile>
                    </GridList>
                    <GridListTile style={{backgroundColor: 'green', height: '50px'}} className={styles.tile}>

                    </GridListTile>
                </GridList>
            </div>
        </AppContent>
        </React.Fragment>
    );
}

export default ProfilePage;
